"""
Write a function to find the longest common prefix string amongst an array of strings.

If there is no common prefix, return an empty string "".

Example 1
Input : str = ["flowers" , "flow" , "fly", "flight" ]
Output : "fl"
Explanation :
All strings given in array contains common prefix "fl".

Example 2
Input : str = ["dog" , "cat" , "animal", "monkey" ]
Output : ""
Explanation :
There is no common prefix among the given strings in array.
"""

# OPTIMAL SOLUTION

# Time Complexity
# O(k * m log m) where m is the number of strings and k is the maximum length of a string.
# Sorting the list of m strings takes O(k * m log m) time because each of the O(m log m)
# comparisons can take up to O(k) time, while the later loop and slicing take O(k) time.

# Space Complexity
# O(m) auxiliary space required by Python's Timsort algorithm to sort the list of string references,
# plus O(k) if the space for the output prefix string is considered.

def longest_prefix(st):
    if not st:
        return ""

    st.sort()

    n = min(len(st[0]), len(st[-1]))

    prefix_length = 0
    for i in range(n):
        if st[0][i] == st[-1][i]:
            prefix_length += 1
        else:
            break

    return st[0][:prefix_length]

